import React, { Component, Fragment } from 'react';
import './App.css';
import Membre from './components/Membre'

const famille = {
  membre1: {
    nom: 'Maksym',
    age: 20
  },
  membre2: {
    nom: 'Luba',
    age: 42
  },
  membre3: {
    nom: 'Andriy',
    age: 45
  },
}

class App extends Component {
  state = {
    famille
  }

  render() {
    const { famille } = this.state
    return (
      <Fragment>
        <div className="App">
          <h1>React App</h1>
          <p>Bounjours Monsieur</p>
          <Membre nom = {famille.membre1.nom}/>
          <Membre nom = 'Luba'/>
          <Membre nom = 'Andriy'>
          <strong>We are the best !</strong>
          </Membre>
        </div>
      </Fragment>
    );
  }
}

export default App;
